import React from "react";
import CourseRowComponent from "./CourseRowComponent";

const courses = [
    {
        _id: "123",
        title: "CS5610",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "234",
        title: "CS4500",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "456",
        title: "CS4800",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "345",
        title: "CS3200",
        owner:"me",
        lastOpened:"yesterday"
    }
]

class CourseListComponents extends React.Component{
    render(){
        return(
            <div>
                <h1>Course List(for{this.props.instructor}) {this.props.term}</h1>
                <table className= "table">
                    {
                        courses.map(item =>
                            <CourseRowComponent item={item}/>
                        )
                    }
                </table>
            </div>
        );
    }
}

export default CourseListComponents;
